import React from 'react'

export default function About() {
  return (
    <div className='about'>
      <h2 className='about__title'>Элитные красивые искусственные ели</h2>
      <span className='about__span'>Доставка по всей России</span>
    <button className='about__btn'></button>
    </div>
  )
}
